import React from 'react';


const RoomList = () => {
    
    
    return (
        <div>
            <h4 className="card-title text-center">Our Chat Here</h4>
            <div className="chat-rooms mb-3 text-center">
                <div className="my-2">Choose a chatroom:</div>
                <button className="btn btn-info btn-lg btn-sm mr-1" id="general">#general</button>
                <button className="btn btn-info btn-lg btn-sm mr-1" id="gaming">#gaming</button>
                <button className="btn btn-info btn-lg btn-sm" id="music">#music</button>
            </div>
        </div>
    );
    
}

export default RoomList
